import React from "react";
import Footer from "./components/Footer";
import { BrowserRouter as Router, Route, NavLink } from "react-router-dom";
import AboutPage from "./pages/About";
import PortfolioPage from "./pages/Portfolio";
import ContactPage from "./pages/Contact";
import PublicationsPage from "./pages/Publications";



function Header(){
  return (
  <nav className="navbar navbar-expand-lg navbar-light bg-dark">
      <NavLink className="navbar-brand"  activeStyle={{ color: 'white' }} to="/">Michael J. O'Connor, CA, CPA</NavLink>
      <div>
        <ul className="navbar-nav">
          <li className="nav-item">
            <NavLink to="/" className="nav-link" activeClassName="active" activeStyle={{
    fontWeight: "bold",
    color: "red"
  }} >About</NavLink>
          </li>
          <li className="nav-item">
            <NavLink to="/portfolio" className="nav-link" activeClassName="active" activeStyle={{
    fontWeight: "bold",
    color: "red"
  }}>Portfolio</NavLink>
          </li>
          <li className="nav-item">
            <NavLink to="/publications" className="nav-link" activeClassName="active" activeStyle={{
    fontWeight: "bold",
    color: "red"
  }}>Publications</NavLink>
          </li>
          <li className="nav-item">
            <NavLink to="/contact" className="nav-link" activeClassName="active" activeStyle={{
    fontWeight: "bold",
    color: "red"
  }}>Contact</NavLink>
          </li>
        </ul>
      </div>
    </nav>
  )
}

function App() { 

  // html
  return (
    <>
      <Router> 
        <Header />
        <Route exact path={["/","/about"]} component={AboutPage} />
        <Route exact path="/portfolio" component={PortfolioPage} />
        <Route exact path="/publications" component={PublicationsPage} />
        <Route exact path="/contact" component={ContactPage} />
      </Router>
      <Footer />
    </>
  );
}

export default App;
